optional = false
python-versions = ">= 3.6"

[package.dependencies]
jmespath = ">=0.7.1,<2.0.0"
python-dateutil = ">=2.1,<3.0.0"
urllib3 = ">=1.25.4,<1.27"

[package.extras]
crt = ["awscrt (==0.13.8)"]

[[package]]
name = "botocore-stubs"
version = "1.27.56"
description = "Type annotations and code completion for botocore"
category = "dev"
optional = false
python-versions = ">=3.7,<4.0"

[package.dependencies]
types-awscrt = "*"

[[package]]
